import React from 'react'
import {Link} from 'react-router-dom'
import './Card.css'

function Card({img, title, diets, id}) {

    return (
         <div>
            {
            <div className='card'>
                <img src={img} alt="img not found" className='image'/>
                <h1 className='title'>{title}</h1>
                {diets ? 
                (typeof diets[0] ==='object' ? diets.map((diet, index)=> <li key={index}>{diet.name}</li>) : diets.map((diet, index)=> <li key={index}>{diet}</li>)) : null
                }
                <Link to ={{
                    pathname: '/home/detail',
                    search: `${id}`
                }}>
                <button>More info</button>
                </Link>
                <hr />
            </div>
            }
        </div>

    )


}

export default Card
